import React, {useEffect} from 'react';
import * as S from './gallery.styles';


const Gallery = ({gallery}) => {


    useEffect(()=> {

    })
    if(gallery) {
    const galleryOdd = gallery.filter((item , i)=> {
        return i % 2 === 0 && item
    });
    const galleryEven = gallery.filter((item , i)=> {
        return i % 2 !== 0 && item
    });

    }


    return (
        <S.Gallery_Container>
            <S.Gallery_Wrapper>
                
                { gallery&&
                    gallery.map((image , i ) => (
                        <img src={image} className={`image-card${i+1}`} key={i+1} alt=""/>
                    ))
                }
            </S.Gallery_Wrapper>
        </S.Gallery_Container>
    )
}
export default Gallery;
